import React, { useState, useEffect } from "react";

const Chat = ({name}, {socket})=> {
    const [chat, setChat] = useState([]);
    useEffect(() => {

      //socket.emit("CHAT")
      socket.on("CHAT", (data) => {
        setChat(data)
      });
    }, []);
    return (

       <h3> Chat:{name} </h3>
      //{chat.map(mensaje => <div>{mensaje.name}</div>)}

    );
}

export default Chat;
